export default class Person extends Component {
    render() {
        return (
            <div>
                姓名：<input type="text"/>
                年龄：<input type="text"/>
                <ul>
                    <li>1</li>
                    <li>2</li>
                    <li>3</li>
                </ul>
            </div>
        )
    }
}
